  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for National Bison
  Range outlines Refuge accomplishments from May through August of 1949. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, and raptors- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, and collections
  and receipts. The public relations section of the report describes recreational
  uses, Refuge visitors, and Refuge participation. N-R forms and photographs are attached.\",\n\t\"license_title\":
